import React, { Component } from 'react'

export default class flights extends Component {
  render() {
    const {flights} = this.flights;
    return (
      <>
      {flights.map((flight, i) => {
                return(
                <l1 key = {i}>
                 <a href={`/api/flights.${i}`}>{flight.id}</a> is {flight.departing}{" "}
                
                <br></br>
                </l1>
                );
            })}
      </>
    )
  }
}
